import React from 'react';

import './index.css';

export default function EditButtons({onEdit, onDelete, onNavigate}) {
  return (
    <>
    <button
      type="button"
      className="btn btn-outline-dark position-absolute top-0 start-50"
      onClick={onEdit}
    >
      <i className="bi bi-pencil-fill"></i>
    </button>
    <button
      type="button"
      className="btn btn-outline-dark position-absolute top-0 start-80"
      onClick={onDelete}
    >
      <i className="bi bi-trash-fill"></i>
    </button>
    <button
      type="button"
      className='btn btn-outline-dark position-absolute top-0 start-100'
      onClick={onNavigate}
    >
      <i className='bi bi-arrows-fullscreen'></i>
    </button>
  </>
  )
}
